import"./style.css";

const BookItem = () => {
    return  (
        <div className="book-item">
            <img src="http://books.google.com/books/content?id=161QAAAAMAAJ&amp;printsec=frontcover&amp;img=1&amp;zoom=5&amp;source=gbs_api" alt="book cover"></img>
        </div>
    );
}

export default BookItem;
